c---- routines to compute the virtual one-loop matrix elements
c---- described in hep-ph/9609474 and hep-ph/9706297

      subroutine setup(s12,s13,s14,s23,s24,s34)
      implicit real*8(a-o,q-z)
      implicit integer(p)
      integer i,j,k,l
      common/ps/p1,p2,p3,p4
      common/ss/s(8,8)
      common/Ls/Lc0(12,12),Lc1(12,14),Lc2(12,14),Lc3(12,14),Lc4(12,14),
     . Lc1s(12,14),Lc2s(12,14),Lc3s(12,14),Lc4s(12,14),
     . Lcd0(8,12,8),Lcd1(8,12,8),Lcd2(8,12,8),Lcd3(8,12,8),
     . Ld0(8,12,12),Ld1s(8,12,12),Ld2s(8,12,12),Ld3s(8,12,12),
     . Ld1(8,12,12),Ld21(8,12,12),Ld22(8,12,12),Ld24(8,12,12),
     . Ld311(8,12,12),Ld314(8,12,12),Ld322(8,12,12),Ld344(8,12,12),
     . Le1(8,8,8,8)
      common/Lsa/Lc0a(12,12),Lc1a(12,14),Lc2a(12,14),Lc3a(12,14),
     . Lcd0a(8,12,8),Lcd1a(8,12,8),Lcd2a(8,12,8),Lcd3a(8,12,8),
     . Ld0a(8,12,12),Ld1sa(8,12,12),Ld2sa(8,12,12),Ld3sa(8,12,12),
     . Ld1a(8,12,12),Ld21a(8,12,12),Ld22a(8,12,12),
     . Ld24a(8,12,12),Ld311a(8,12,12),Ld314a(8,12,12),Ld322a(8,12,12),
     . Ld344a(8,12,12),Le1a(8,8,8,8)

      common/newas12/Ld21as12(8,12,12),Ld22as12(8,12,12),
     .Ld24as12(8,12,12),Ld311as12(8,12,12),
     .Ld314as12(8,12,12),Ld322as12(8,12,12)
      common/newas23/Ld21as23(8,12,12),Ld22as23(8,12,12),
     .Ld24as23(8,12,12),Ld311as23(8,12,12),
     .Ld314as23(8,12,12),Ld322as23(8,12,12)
      dimension pp(4) 

*
* set integers pi such that pij = pi+pj, pijk=pi+pj+pk
* the pointers pp(i) (i=1..4) point to these integers
*
* p12 = 3, p13 = 5, p14 = 9, p23 = 6, p24 = 10, p34 = 12
* p123 = 7, p124 = 11, p134 = 13, p234 = 14
*
      p1=1
      p2=2
      p3=4
      p4=8
      pp(1)=p1
      pp(2)=p2
      pp(3)=p3
      pp(4)=p4

      do i=1,8
      do j=1,8
      s(i,j)=0d0
      enddo
      enddo
      s(p1,p2)=s12
      s(p1,p3)=s13
      s(p1,p4)=s14
      s(p2,p3)=s23
      s(p2,p4)=s24
      s(p3,p4)=s34
      sijkl=s12+s13+s14+s23+s24+s34
      do i=1,7
      do j=i+1,8
      s(j,i)=s(i,j)
      enddo
      enddo

*
* set up massless Lc's and Lcd's
*
      do l=1,4
      do j=1,3
      do k=j+1,4
      if(j.eq.l.or.k.eq.l)goto 10
      pl=pp(l)
      pj=pp(j)
      pk=pp(k)
      pjk=pj+pk
      sjk=s(pj,pk)
      pi=15-pl-pj-pk
      pijk=pi+pj+pk
      pjkl=pjk+pl
      sjkl=sjk+s(pj,pl)+s(pk,pl)
      Lc1(pl,pjk)=xlc1(sjk,sjkl)
      Lc2(pl,pjk)=xlc2(sjk,sjkl,Lc1(pl,pjk))
      Lc3(pl,pjk)=xlc3(sjk,sjkl,Lc2(pl,pjk))
      Lc1a(pl,pjk)=1d0/sjk
      Lc2a(pl,pjk)=1d0/2d0/sjk
      Lc3a(pl,pjk)=1d0/3d0/sjk
      sijk=s(pj,pk)+s(pi,pj)+s(pi,pk)
      sijkl=sjkl+s(pi,pj)+s(pi,pk)+s(pi,pl)
      Lc1(pl,pijk)=xlc1(sijk,sijkl)
      Lc2(pl,pijk)=xlc2(sijk,sijkl,Lc1(pl,pijk))
      Lc3(pl,pijk)=xlc3(sijk,sijkl,Lc2(pl,pijk))
      Lc1a(pl,pijk)=1d0/sijk
      Lc2a(pl,pijk)=1d0/2d0/sijk
      Lc3a(pl,pijk)=1d0/3d0/sijk

      Lcd0(pi,pjk,pl)=xlcd0(sjk,sijk,sjkl,sijkl)
      Lcd1(pi,pjk,pl)=
     .       xlcdn(sjk,sijk,sjkl,sijkl,Lc1(pl,pijk),Lc1(pl,pjk))
      Lcd2(pi,pjk,pl)=
     .       xlcdn(sjk,sijk,sjkl,sijkl,Lc2(pl,pijk),Lc2(pl,pjk))
      Lcd3(pi,pjk,pl)=
     .       xlcdn(sjk,sijk,sjkl,sijkl,Lc3(pl,pijk),Lc3(pl,pjk))


   10 continue
      enddo
      enddo
      enddo

*
* set up massive Lc's
*
      do i=1,3
      do j=i+1,4
      do k=1,3
      do l=k+1,4
      if(i.eq.k.or.i.eq.l.or.j.eq.k.or.j.eq.l)goto 20
      pi=pp(i)
      pj=pp(j)
      pk=pp(k)
      pl=pp(l)
      pij=pi+pj
      sij=s(pi,pj)
      pkl=pk+pl
      skl=s(pk,pl)
      if(pij.gt.pkl)goto 20
      lambda2=d2(sijkl,sij,skl)

      Lc0(pij,pkl)=xlc0(sij,skl,sijkl,lambda2)
      Lc0(pkl,pij)=Lc0(pij,pkl) 
      Lc1(pij,pkl)=xlc1m(sij,skl,sijkl,lambda2,Lc0(pij,pkl))
      Lc1(pkl,pij)=xlc1m(skl,sij,sijkl,lambda2,Lc0(pkl,pij))
      Lc2(pij,pkl)=xlc2m(sij,skl,sijkl,lambda2,Lc0(pij,pkl),
     . Lc1(pij,pkl),Lc1(pkl,pij))
      Lc2(pkl,pij)=Lc2(pij,pkl)
      Lc3(pij,pkl)=xlc3m(sij,skl,sijkl,lambda2,Lc0(pij,pkl),
     . Lc1(pij,pkl))
      Lc3(pkl,pij)=xlc3m(skl,sij,sijkl,lambda2,Lc0(pkl,pij),
     . Lc1(pkl,pij))

      Lc0a(pij,pkl)=xlc0a(sij,skl,sijkl)
      Lc0a(pkl,pij)=Lc0a(pij,pkl) 
      Lc1a(pij,pkl)=xlc1ma(sij,skl,sijkl,Lc0a(pij,pkl))
      Lc1a(pkl,pij)=xlc1ma(skl,sij,sijkl,Lc0a(pkl,pij))
      Lc3a(pij,pkl)=xlc3ma(sij,skl,sijkl,Lc1a(pij,pkl))
      Lc3a(pkl,pij)=xlc3ma(skl,sij,sijkl,Lc1a(pkl,pij))
      Lc2a(pij,pkl)=xlc2ma(sij,skl,sijkl,Lc3a(pij,pkl),
     . Lc1a(pij,pkl),Lc1a(pkl,pij))
      Lc2(pkl,pij)=Lc2(pij,pkl)

      Lc1s(pij,pkl)=(Lc1(pij,pkl)*skl+Lc1(pkl,pij)*sij)/2d0
      Lc1s(pkl,pij)=Lc1s(pij,pkl)
      Lc2s(pij,pkl)=xlc2s(sij,skl,sijkl,lambda2,Lc1s(pij,pkl))
      Lc2s(pkl,pij)=Lc2s(pij,pkl)
      Lc3s(pij,pkl)=xlc3s(sij,skl,sijkl,lambda2,Lc2s(pij,pkl))
      Lc3s(pkl,pij)=Lc3s(pij,pkl)
      Lc4s(pij,pkl)=xlc4s(sij,skl,sijkl,lambda2,Lc3s(pij,pkl))
      Lc4s(pkl,pij)=Lc4s(pij,pkl)


   20 continue
      enddo
      enddo
      enddo
      enddo

*
* set up massless Ld's
*
      do i=1,3
      do j=1,4
      do k=i+1,4
      if(i.eq.j.or.i.eq.k.or.j.eq.k)goto 30
      pi=pp(i)
      pj=pp(j)
      pk=pp(k)
      sij=s(pi,pj)
      sjk=s(pj,pk)
      sijk=sij+sjk+s(pi,pk)

      Ld0(pi,pj,pk)=xld0(sij,sjk,sijk)
      Ld1s(pi,pj,pk)=xld1s(sij,sjk,sijk,Ld0(pi,pj,pk))
      Ld2s(pi,pj,pk)=xld2s(sij,sjk,sijk,Ld1s(pi,pj,pk))
      Ld3s(pi,pj,pk)=xld3s(sij,sjk,sijk,Ld2s(pi,pj,pk))
      Ld0(pk,pj,pi)=Ld0(pi,pj,pk)
      Ld1s(pk,pj,pi)=Ld1s(pi,pj,pk)
      Ld2s(pk,pj,pi)=Ld2s(pi,pj,pk)
      Ld3s(pk,pj,pi)=Ld3s(pi,pj,pk)

      Ld0a(pi,pj,pk)=0
      Ld1sa(pi,pj,pk)=xld1sa(sij,sjk,sijk)
      Ld2sa(pi,pj,pk)=xld2sa(sij,sjk,sijk)
      Ld3sa(pi,pj,pk)=xld3sa(sij,sjk,sijk)
      Ld0a(pk,pj,pi)=Ld0a(pi,pj,pk)
      Ld1sa(pk,pj,pi)=Ld1sa(pi,pj,pk)
      Ld2sa(pk,pj,pi)=Ld2sa(pi,pj,pk)
      Ld3sa(pk,pj,pi)=Ld3sa(pi,pj,pk)

   30 continue
      enddo
      enddo
      enddo

c     **** set up new functions and their approximations ***

      do i=1,4
      do j=1,4
      do k=1,4
      if(i.eq.j.or.i.eq.k.or.j.eq.k)goto 35
      pi=pp(i)
      pj=pp(j)
      pk=pp(k)
      pij=pi+pj
      pjk=pj+pk
      sij=s(pi,pj)
      sjk=s(pj,pk)
      sijk=sij+sjk+s(pi,pk)

      Ld1(pi,pj,pk)=-Ld1s(pi,pj,pk)
      Ld21(pi,pj,pk)=xld21(sij,sjk,sijk,Ld2s(pi,pj,pk)
     .,Lc1(pi,pjk))
      Ld311(pi,pj,pk)=xld311(sij,sjk,sijk,Ld3s(pi,pj,pk)
     .,Lc2(pi,pjk),Lc1(pi,pjk))
      Ld314(pi,pj,pk)=xld314(sij,sjk,sijk,Ld3s(pi,pj,pk)
     .,Lc1(pi,pjk),Lc1(pk,pij))
    
      Ld1a(pi,pj,pk)=-Ld1sa(pi,pj,pk)
      Ld21a(pi,pj,pk)=xld21(sij,sjk,sijk,Ld2sa(pi,pj,pk)
     .,Lc1(pi,pj+pk))
      Ld311a(pi,pj,pk)=xld311(sij,sjk,sijk,Ld3sa(pi,pj,pk)
     .,Lc2(pi,pj+pk),Lc1(pi,pj+pk))
      Ld314a(pi,pj,pk)=xld314(sij,sjk,sijk,Ld3sa(pi,pj,pk)
     .,Lc1(pi,pj+pk),Lc1(pk,pi+pj))

      Ld21as12(pi,pj,pk)=xld21as12(sij,sjk,sijk,Ld1(pi,pj,pk))
      Ld311as12(pi,pj,pk)=xld311as12(sij,sjk,sijk
     .,Ld1(pi,pj,pk))


   35 continue
      enddo
      enddo
      enddo
*
* set up massive Ld's ( *including opposite box* )
*
      do i=1,4
      do j=1,4
      do k=1,3
      if(i.eq.j.or.i.eq.k.or.j.eq.k)goto 40
      pi=pp(i)
      pj=pp(j)
      pk=pp(k)
      pl=15-pi-pj-pk
      if(pl.lt.pk)goto 40
      pij=pi+pj
      pkl=pk+pl
      pijk=pij+pk
      pjkl=pj+pkl
      sij=s(pi,pj)
      skl=s(pk,pl)
      sikl=s(pi,pk)+s(pi,pl)+skl
      sjkl=s(pj,pk)+s(pj,pl)+skl

      Ld0(pi,pkl,pj)=xld0opp(skl,sikl,sjkl,sijkl)
      Ld1(pi,pkl,pj)=xld1opp(skl,sikl,sjkl,sijkl,Ld0(pi,pkl,pj))
      Ld21(pi,pkl,pj)=xld21opp(skl,sikl,sjkl,sijkl,Ld1(pi,pkl,pj),
     .Lc1(pi,pjkl),Lc1(pi,pkl))

      Ld0(pi,pj,pkl)=xld0m(sij,sjkl,skl,sijkl)
      Ld1s(pi,pj,pkl)=
     .      xld1sm(sij,sjkl,skl,sijkl,Ld0(pi,pj,pkl),Lc0(pij,pkl))
      Ld2s(pi,pj,pkl)=
     .      xld2sm(sij,sjkl,skl,sijkl,Ld1s(pi,pj,pkl),Lc1s(pij,pkl))
      Ld3s(pi,pj,pkl)=
     .      xld3sm(sij,sjkl,skl,sijkl,Ld2s(pi,pj,pkl),Lc2s(pij,pkl))
      
      Ld0a(pi,pj,pkl)=xld0ma(sij,sjkl,skl,sijkl,Lc0(pkl,pij))
      Ld1sa(pi,pj,pkl)=xld1sma(sij,sjkl,skl,sijkl,Lc1s(pkl,pij))
      Ld2sa(pi,pj,pkl)=xld2sma(sij,sjkl,skl,sijkl,Lc2s(pkl,pij))
      Ld3sa(pi,pj,pkl)=xld3sma(sij,sjkl,skl,sijkl,Lc3s(pkl,pij))
      
      Ld1(pi,pj,pkl)=-(Ld1s(pi,pj,pkl)+Lc0(pij,pkl))
      Ld21(pi,pj,pkl)=xld21m(sij,sjkl,skl,sijkl,Ld2s(pi,pj,pkl),
     .Lc1s(pkl,pij),Lc1(pij,pkl))
      Ld22(pi,pj,pkl)=xld22m(sij,sjkl,skl,sijkl,Ld2s(pi,pj,pkl),
     .Lc1s(pkl,pij),Lc1(pj,pkl),Lc1(pij,pkl))
      Ld24(pi,pj,pkl)=xld24m(sij,sjkl,skl,sijkl,Ld2s(pi,pj,pkl),
     .Lc1s(pkl,pij),Lc1(pi,pjkl),Lc1(pij,pkl))
      Ld311(pi,pj,pkl)=xld311m(sij,sjkl,skl,sijkl,Ld3s(pi,pj,pkl),
     .Lc2s(pkl,pij),Lc3(pij,pkl),Lc2(pkl,pij))
      Ld314(pi,pj,pkl)=xld314m(sij,sjkl,skl,sijkl,Ld3s(pi,pj,pkl),
     .Lc2s(pkl,pij),Lc3(pij,pkl),Lc2(pkl,pij),Lc1(pi,pjkl))
      Ld322(pi,pj,pkl)=xld322m(sij,sjkl,skl,sijkl,Ld3s(pi,pj,pkl),
     .Lc2s(pkl,pij),Lc3(pij,pkl),Lc2(pj,pkl),Lc1(pi,pjkl),
     .Lc2(pkl,pij),Lc1(pj,pkl))
      Ld344(pi,pj,pkl)=xld344m(sij,sjkl,skl,sijkl,Ld3s(pi,pj,pkl),
     .Lc2s(pkl,pij),Lc2(pkl,pij),Lc3(pij,pkl),Lc1(pi,pjkl),
     .Lc2(pi,pjkl))
      
      Ld1a(pi,pj,pkl)=-(Ld1sa(pi,pj,pkl)+Lc0(pij,pkl))
      Ld21a(pi,pj,pkl)=xld21m(sij,sjkl,skl,sijkl,Ld2sa(pi,pj,pkl),
     .Lc1s(pkl,pij),Lc1(pij,pkl))
      Ld22a(pi,pj,pkl)=xld22m(sij,sjkl,skl,sijkl,Ld2sa(pi,pj,pkl),
     .Lc1s(pkl,pij),Lc1(pj,pkl),Lc1(pij,pkl))
      Ld24a(pi,pj,pkl)=xld24m(sij,sjkl,skl,sijkl,Ld2sa(pi,pj,pkl),
     .Lc1s(pkl,pij),Lc1(pi,pjkl),Lc1(pij,pkl))
      Ld311a(pi,pj,pkl)=xld311m(sij,sjkl,skl,sijkl,Ld3sa(pi,pj,pkl),
     .Lc2s(pkl,pij),Lc3(pij,pkl),Lc2(pkl,pij))
      Ld314a(pi,pj,pkl)=xld314m(sij,sjkl,skl,sijkl,Ld3sa(pi,pj,pkl),
     .Lc2s(pkl,pij),Lc3(pij,pkl),Lc2(pkl,pij),Lc1(pi,pjkl))
      Ld322a(pi,pj,pkl)=xld322m(sij,sjkl,skl,sijkl,Ld3sa(pi,pj,pkl),
     .Lc2s(pkl,pij),Lc3(pij,pkl),Lc2(pj,pkl),Lc1(pi,pjkl),
     .Lc2(pkl,pij),Lc1(pj,pkl))
      Ld344a(pi,pj,pkl)=xld344m(sij,sjkl,skl,sijkl,Ld3sa(pi,pj,pkl),
     .Lc2s(pkl,pij),Lc2(pkl,pij),Lc3(pij,pkl),Lc1(pi,pjkl),
     .Lc2(pi,pjkl))


   40 continue
      enddo
      enddo
      enddo

*
* setup Le1
*
      do i=1,3
      do l=i+1,4
      do j=1,4
      if(i.eq.j.or.i.eq.l.or.j.eq.l)goto 50
      pi=pp(i)
      pj=pp(j)
      pl=pp(l)
      pk=15-pi-pj-pl
      pij=pi+pj
      pkl=pk+pl
      sjk=s(pj,pk)
      sijk=s(pi,pj)+s(pi,pk)+sjk
      sjkl=sjk+s(pj,pl)+s(pk,pl)
      Le1(pi,pj,pk,pl)=(Ld0(pi,pj,pk)+Ld0(pl,pk,pij)
     . -Ld0(pj,pk,pl)-Ld0(pi,pj,pkl))/(sijk*sjkl-sjk*sijkl)
      Le1(pl,pk,pj,pi)=-Le1(pi,pj,pk,pl)


   50 continue
      enddo
      enddo
      enddo
      return
      end

      function xld0(s12,s23,s123)
      implicit real*8(a-z)
      parameter(zeta2 =  1.644934066848226d0)
      xld0=li2(1d0-s12/s123)+li2(1d0-s23/s123)
     .      +log(s12/s123)*log(s23/s123)-zeta2
      return
      end
      function xld1s(s12,s23,s123,rld0)
      implicit real*8(a-z)
      xld1s=-rld0/(s123-s12-s23)
      return
      end
      function xld1sa(s12,s23,s123)
      implicit real*8(a-z)
      xld1sa=-(s12*log(s123/s12)+s23*log(s123/s23))/s12/s23
      return
      end
      function xld2s(s12,s23,s123,rld1)
      implicit real*8(a-z)
      xld2s=-(s12*s23*rld1+s12*log(s123/s12)
     .        +s23*log(s123/s23))/6d0/(s123-s12-s23)
      return
      end
      function xld2sa(s12,s23,s123)
      implicit real*8(a-z)
      xld2sa=-(s12**2*log(s123/s12)
     .     +s23**2*log(s123/s23)+s12*s23)
     .     /12d0/s12/s23
      return
      end
      function xld21(s12,s23,s123,rld2,rlc1)
      implicit real*8(a-z)
      xld21=-(6*rld2+s23*rlc1)/s12
      return
      end
      function xld21as12(s12,s23,s123,rld1)
      implicit real*8(a-z)
      xld21as12=log(s123/s12)/(s123-s12-s23)
     .        +log(s123/s23)*s23/(s123-s12-s23)**2
     .        +rld1*s23/(s123-s12-s23)
      return
      end
      function xld3s(s12,s23,s123,rld2)
      implicit real*8(a-z)
      xld3s=-(s12*s23*rld2+s12**2/12d0*log(s123/s12)
     .      +s23**2/12d0*log(s123/s23)+s12*s23/12d0)
     .      /10d0/(s123-s12-s23)
      return
      end
      function xld3sa(s12,s23,s123)
      implicit real*8(a-z)
      xld3sa=-(s12**3*log(s123/s12)
     .     +s23**3*log(s123/s23)
     .     +s12*s23*(s123+s12+s23)/4d0)/180d0/s12/s23
      return
      end
      function xld311(s12,s23,s123,rld3,rlc2,rlc1)
      implicit real*8(a-z)
      xld311=-(60d0*rld3+s23**2*rlc1/2d0
     .        +s12*s23*rlc2/2d0)/s12**2
      return
      end
      function xld311as12(s12,s23,s123,rld1)
      implicit real*8(a-z)
      xld311as12=log(s123/s12)*(-s23/(s123-s12-s23)**2
     .         +1d0/2d0/(s123-s12-s23))
     .        -3d0/2d0*log(s123/s23)*s23**2/(s123-s12-s23)**3
     .        +s23/(s123-s12-s23)**2/2d0
     .        -rld1*s23**2/(s123-s12-s23)**2
      return
      end
      function xld314(s12,s23,s123,rld3,rlc1a,rlc1b)
      implicit real*8(a-z)
      xld314=-(60*rld3+s23**2*rlc1a/2d0
     .        +s12**2*rlc1b/2d0)/s12/s23
      return
      end      
      function xld0opp(s23,s123,s234,s1234)
      implicit real*8(a-z)
      xld0opp=-li2(1d0-s23/s123)-li2(1d0-s23/s234)
     .+li2(1d0-s123/s1234)+li2(1d0-s234/s1234)
     .+li2(1d0-s23*s1234/s123/s234)+log(s123/s1234)*log(s234/s1234)
      return
      end
      function xld1opp(s23,s123,s234,s1234,rld0)
      implicit real*8(a-z)
      xld1opp=rld0/(s1234+s23-s123-s234)
      return
      end
      function xld21opp(s23,s123,s234,s1234,rld1,rlc1a,rlc1b)
      implicit real*8(a-z)
      xld21opp=((s23-s234)*rld1+s234*rlc1a-s23*rlc1b
     .          +log(s1234/s123))/(s1234+s23-s123-s234)
      return
      end
      function xld0m(s12,s234,s34,s1234)
      implicit real*8(a-z)
      xld0m=li2(1d0-s234/s1234)-li2(1d0-s34/s234)
     .    +0.5d0*log(s234**2/s1234/s34)*log(s12/s1234)
      return
      end
      function xld0ma(s12,s234,s34,s1234,lc0)
      implicit real*8(a-z)
      xld0ma=-(s1234+s34-s12-2*s34*s1234/s234)*lc0/2d0
      return
      end
      function xld1sm(s12,s234,s34,s1234,rld0,rlc0)
      implicit real*8(a-z)
      xld1sm=-s234/((s1234-s234)*(s234-s34)-s12*s234)
     . *(rld0+(s1234+s34-s12-2d0*s1234*s34/s234)*rlc0/2d0)
      return
      end
      function xld1sma(s12,s234,s34,s1234,rlc1s)
      implicit real*8(a-z)
      xld1sma=-((s1234+s34-s12-2d0*s34*s1234/s234)*rlc1s
     .+s12/2d0*log(s1234/s12)+s234*log(s1234/s234)
     .-s34/2d0*log(s1234/s34))/s234/s12
      return
      end
      function xld2sm(s12,s234,s34,s1234,rld1,rlc1s)
      implicit real*8(a-z)
      xld2sm=-s234/6d0/((s1234-s234)*(s234-s34)-s12*s234)
     . *(s12*s234*rld1
     .   +(s1234+s34-s12-2d0*s1234*s34/s234)*rlc1s 
     .   +s12/2d0*log(s1234/s12)+s234*log(s1234/s234)
     .   -s34/2d0*log(s1234/s34))
      return
      end
      function xld2sma(s12,s234,s34,s1234,rlc2s)
      implicit real*8(a-z)
      xld2sma=-((s1234+s34-s12-2d0*s34*s1234/s234)*rlc2s
     .+s12**2/2d0*log(s1234/s12)+s234**2*log(s1234/s234)
     .-s34**2/2d0*log(s1234/s34)+s234*s12)/12d0/s234/s12
      return
      end
      function xld21m(s12,s234,s34,s1234,rld2,rlc1s,rlc1)
      implicit real*8(a-z)
      xld21m=-2d0/s234*(3d0*rld2+rlc1s)-rlc1
