      end
      function xld22m(s12,s234,s34,s1234,rld2,rlc1s,rlc1m,rlc1)
      implicit real*8(a-z)
      xld22m=2d0/s234/s12*(s1234-s234)*(3d0*rld2+rlc1s)
     .        -s234/s12*rlc1m+s1234/s12*rlc1
      return
      end
      function xld24m(s12,s234,s34,s1234,rld2,rlc1s,rlc1m,rlc1)
      implicit real*8(a-z)
      xld24m=2d0/s234/s12*(s34-s234)*(3d0*rld2+rlc1s)
     .        -s234/s12*rlc1m+s34/s12*rlc1
