      end
      function xld2m4a123(s12,s123,s34,s1234,rlc1s,rlc1m,rlc1)
      implicit real*8(a-z)
      xld2m4a123=(2d0*(s34-s12-s1234)*rlc1s+s34*log(s1234/s34)
     .         -s12*log(s1234/s12))/4d0/s12/s1234*2d0*(s12-s123)/s34
     .         -s123/s34*rlc1m+s12/s34*rlc1
      return
      end
      function xld2m4a34(s12,s123,s34,s1234,rld1,rlc0,rlc1m)
      implicit real*8(a-z)
      xld2m4a34=-s123/(s1234-s123)/(s1234-s12)*log(s34/s1234)
     .          -s12*s123/(s1234-s123)/(s1234-s12)*rlc0
     .	 	+s123/(s1234-s123)*rld1
     .		+s123**2/(s1234-s123)/(s123-s12)*rlc1m
     .		+s12*s123/(s1234-s12)**2/(s1234-s123)
     .            /(s123-s12)*(s12-2d0*s123+s1234)*log(s12/s1234)
      return
      end
      function xld3sm(s12,s234,s34,s1234,rld2,rlc2s)
      implicit real*8(a-z)
      xld3sm=-s234/10d0/((s1234-s234)*(s234-s34)-s12*s234)
     . *(s12*s234*rld2
     .   +(s1234+s34-s12-2d0*s1234*s34/s234)*rlc2s 
     .   +s12**2/24d0*log(s1234/s12)+s234**2/12d0*log(s1234/s234)
     .   -s34**2/24d0*log(s1234/s34)+s12*s234/12d0)
      return
      end
      function xld3sma(s12,s234,s34,s1234,rlc3s)
      implicit real*8(a-z)
      xld3sma=-((s1234+s34-s12-2d0*s34*s1234/s234)*rlc3s
     .+s12**3/2d0*log(s1234/s12)+s234**3*log(s1234/s234)
     .-s34**3/2d0*log(s1234/s34)
     .+s12*s234*(s1234+s234+s12+s34)/4d0)/180d0/s234/s12
      return
      end
      function xld311m(s12,s234,s34,s1234,rld3,rlc2s,rlc3,
     .rlc2)
      implicit real*8(a-z)
      xld311m=-(12/s234**2*(5d0*rld3+rlc2s)
     .         +(s234+s34)/s234*rlc3+s12/s234*rlc2)
      return
      end
      function xld314m(s12,s234,s34,s1234,rld3,rlc2s,rlc3,
     .                 rlc2,rlc1m)
      implicit real*8(a-z)
      xld314m=12*(s34-s234)/s234**2/s12*(5d0*rld3+rlc2s)
     .	    +s34**2/s234/s12*rlc3-(s234-s34)/s234*rlc2
     .          -s234/2d0/s12*rlc1m
      return
      end
      function xld322m(s12,s234,s34,s1234,rld3,rlc2s,rlc3,rlc2m,
     .                 rlc1a,rlc2,rlc1b)
      implicit real*8(a-z)
      xld322m=-(12*(s1234-s234)**2/s234**2/s12**2*(5d0*rld3+rlc2s)
     .          +s1234*(s234*s1234+s34*s1234-2d0*s34*s234)
     .           /s234/s12**2*rlc3-s234/2d0/s12*rlc2m
     .	    +s234*(s234-s1234)/2d0/s12**2*rlc1a
     .          +s1234*(s1234-2d0*s234)/s234/s12*rlc2
     .	    +(s34*s234+s234*s12-s234*s1234)/2d0/s12**2*rlc1b)
      return
      end
      function xld344m(s12,s234,s34,s1234,rld3,rlc2s,rlc2,rlc3,
     .                 rlc1m,rlc2m)
      implicit real*8(a-z)
      xld344m=-(12*(s234-s34)**2/s234**2/s12**2*(5d0*rld3+rlc2s)
     .          +s34*(s34-2d0*s234)/s234/s12*rlc2
     .	    +s34**2*(s34-s234)/s234/s12**2*rlc3
     .          +s234*(s234-s34)/2d0/s12**2*rlc1m
     .          +s234/2d0/s12*rlc2m)
      return
      end
      function xld3m22a34(s12,s123,s34,s1234,rld1,rlc0,rlc1m)
      implicit real*8(a-z)
      xld3m22a34=(s123*(s12**2+s12*s1234-2d0*s123*s1234)/
     . (s12-s1234)**2/2d0
     . +(s12**2-s123*s1234)*s123*s1234/(s12-s1234)**2*rlc0
     . -s123**2*rld1+3d0/2d0*s123**3/(s12-s123)*rlc1m
     . +s123*(s12**2+s12*s1234+s12*s123-3d0*s123*s1234)/2d0/
     . (s12-s1234)**2*log(s34/s1234)
     . -s123*(3d0*s123**2*s1234**2-15d0*s1234*s12**2*s123
     .  +4d0*s1234*s12*s123**2+5d0*s1234*s12**3+3d0*s12**3*s123
     .  +s12**4-s12**2*s123**2)/2d0
     .   /(s12-s123)/(s12-s1234)**3*log(s12/s1234))/(s12-s123)**2
      return
      end
      function xlcd0(s23,s123,s234,s1234)
      implicit real*8(a-z)
      xlcd0=log(s123*s234/s23/s1234)/(s123*s234-s23*s1234)
      return
      end
      function xlcdn(s23,s123,s234,s1234,rlcna,rlcnb)
      implicit real*8(a-z)
      xlcdn=(s123*rlcna-s23*rlcnb)/(s123*s234-s23*s1234)
      return
      end
      function xlc1(s23,s123)
      implicit real*8(a-z)
      xlc1=log(s123/s23)/(s123-s23)
      return
      end
      function xlc2(s23,s123,rlc1)
      implicit real*8(a-z)
      xlc2=-(s23*rlc1-1d0)/(s123-s23)
      return
      end
      function xlc3(s23,s123,rlc2)
      implicit real*8(a-z)
      xlc3=-(s23*rlc2-0.5d0)/(s123-s23)
      return
      end
      function xlc0(s12,s34,s1234,lambda2)
      implicit real*8(a-z)
      lambda=sqrt(lambda2)
      ap=(s1234+s34-s12+lambda)/2d0/s1234
      am=(s1234+s34-s12-lambda)/2d0/s1234
      xlc0=(log(ap*am)*log((1d0-ap)/(1d0-am))
     .           +2d0*li2(ap)-2d0*li2(am))/lambda
      return
      end
      function xlc0a(s12,s34,s1234)
      implicit real*8(a-z)    
      xlc0a=1d0/2d0/s12/s34/s1234*(s12*(s1234+s34-s12)*
     .  log(s1234/s12)+s34*(s1234+s12-s34)*log(s1234/s34))
      return
      end
      function xlc1m(s12,s34,s1234,lambda2,rlc0)
      implicit real*8(a-z)
      xlc1m=-(s12*(s1234-s12+s34)*rlc0
     .  -(s1234-s12-s34)*log(s1234/s34) 
     .  -2d0*s12*log(s1234/s12))/lambda2 
      return
      end
      function xlc1ma(s12,s34,s1234,rlc0)
      implicit real*8(a-z)
      xlc1ma=1d0/3d0/s12/(s1234+s34-s12)*((s1234-s34)*
     . log(s1234/s34)+2*s12-s12**2*rlc0)
      return
      end
      function xlc2m(s12,s34,s1234,lambda2,rlc0,rlc1a,rlc1b)
      implicit real*8(a-z)
      xlc2m=-(2d0*s34*(s1234+s12-s34)*rlc1a
     .  +s12*(s1234+s34-s12)*rlc1b-s12*s34*rlc0
     .  -s34*log(s1234/s34)+s12+s34-s1234)/2d0/lambda2
      return
      end
      function xlc2ma(s12,s34,s1234,rlc3,rlc1a,rlc1b)
      implicit real*8(a-z)
      xlc2ma=1d0/6d0/s34/(s1234+s12-s34)*(-4d0*s34*
     . (s1234+s12-s34)*rlc3+s1234-s34+3d0*s12*s34*rlc1a
     . -s12**2*rlc1b+s34*log(s1234/s34))
      return
      end
      function xlc3m(s12,s34,s1234,lambda2,rlc0,rlc1)
      implicit real*8(a-z)
      xlc3m=-(3d0*s12*(s1234+s34-s12)*rlc1+s12**2*rlc0
     .       -(s1234-s34)*log(s1234/s34)-2d0*s12)/2d0/lambda2
      return
      end
      function xlc3ma(s12,s34,s1234,rlc1)
      implicit real*8(a-z)
      xlc3ma=1d0/5d0/s12/(s1234+s34-s12)*((s1234-s34)*
     . log(s1234/s34)+s12-2d0*s12**2*rlc1)
      return
      end
      function xlc2s(s12,s34,s1234,lambda2,rlc1s)
      implicit real*8(a-z)
      xlc2s=-(2d0*s1234*s12*s34*rlc1s-s1234*s12*s34/3d0
     .   -(s12**2*(s1234+s34-s12)*log(s1234/s12)
     .   +s34**2*(s1234+s12-s34)*log(s1234/s34))/6d0)/4d0/lambda2
      return
      end
      function xlc3s(s12,s34,s1234,lambda2,rlc2s)
      implicit real*8(a-z)
      xlc3s=-(2d0*s1234*s12*s34*rlc2s
     .  -s1234*s12*s34*(s12+s34+s1234)/120d0
     .  -(s12**3*(s1234+s34-s12)*log(s1234/s12)
     .  +s34**3*(s1234+s12-s34)*log(s1234/s34))/60d0)/6d0/lambda2
      return
      end
      function xlc4s(s12,s34,s1234,lambda2,rlc3s)
      implicit real*8(a-z)
      xlc4s=-(2d0*s1234*s12*s34*rlc3s
     . -s1234*s12*s34*(s12**2+s34**2+s1234**2+s12*s34+s12*s1234
     . +s34*s1234)*2d0/840d0/9d0
     . -(s12**4*(s1234+s34-s12)*log(s1234/s12)
     . +s34**4*(s1234+s12-s34)*log(s1234/s34))/840d0)/8d0/lambda2
      return
      end
      function d2(a,b,c)
      implicit real*8(a-z)
      d2=a**2+b**2+c**2-2d0*(a*b+a*c+b*c)
      return
      end
  
c
c real dilogarithm function  0 <= x <= 1
c
      function li2(x)
      implicit real*8(a-z)
      parameter(a1 = -0.250000000000000d0)
      parameter(a2 = -0.111111111111111d0)
      parameter(a3 = -0.010000000000000d0)
      parameter(a4 = -0.0170068027210884d0)
      parameter(a5 = -0.0194444444444444d0)
      parameter(a6 = -0.0206611570247934d0)
      parameter(a7 = -0.0214173006480699d0)
      parameter(a8 = -0.0219488663772311d0)
      parameter(a9 = -0.0220893589994137d0)
      parameter(a10 = -0.0229303207720760d0)
      parameter(zeta2 =  1.644934066848226d0)
      li2=0d0
      if(x.gt.1.d0)then
        write(*,*)' argument greater than 1 passed to li2'
        li2=0d0
        return
      elseif(x.lt.0.d0)then
        write(*,*)' argument less than 0 passed to li2'
        li2=0d0
        return
      elseif(x.eq.1.d0)then
        li2=zeta2
        return
      elseif(x.eq.0.d0)then
        li2=0d0
        return
      elseif(x.gt.0.5d0)then
        y=1d0-x
        z=-log(1d0-y)
        z2=z*z
        li2=-z*(1d0+a1*z*(1d0+a2*z*(1d0+a3*z2*(1d0+a4*z2*
     1 (1d0+a5*z2*(1d0+a6*z2*(1d0+a7*z2*(1d0+a8*z2*(1d0+a9*z2*
     2 (1d0+a10*z2))))))))))
     3 +zeta2-log(x)*log(1.d0-x)
       return
      elseif(x.le.0.5d0)then
        y=x
        z=-log(1d0-y)
        z2=z*z
        li2=z*(1d0+a1*z*(1d0+a2*z*(1d0+a3*z2*(1d0+a4*z2*
     1 (1d0+a5*z2*(1d0+a6*z2*(1d0+a7*z2*(1d0+a8*z2*(1d0+a9*z2*
     2 (1d0+a10*z2))))))))))
        return
      endif
      return
      end
      function LA(p1,p2,p3,p4)
      implicit real*8(a-o,q-z)
      implicit integer(p)

      LA=LAa(p1,p2,p3,p4)+LAb(p1,p2,p3,p4)+LAc(p1,p2,p3,p4)
     .  +LAd(p1,p2,p3,p4)+LAe(p1,p2,p3,p4)

      return
      end

      function LAa(p1,p2,p3,p4)
      implicit real*8(a-o,q-z)
      implicit integer(p)
      common/ss/s(8,8)
      common/Ls/Lc0(12,12),Lc1(12,14),Lc2(12,14),Lc3(12,14),Lc4(12,14),
     . Lc1s(12,14),Lc2s(12,14),Lc3s(12,14),Lc4s(12,14),
     . Lcd0(8,12,8),Lcd1(8,12,8),Lcd2(8,12,8),Lcd3(8,12,8),
     . Ld0(8,12,12),Ld1s(8,12,12),Ld2s(8,12,12),Ld3s(8,12,12),
     . Ld1(8,12,12),Ld21(8,12,12),Ld22(8,12,12),Ld24(8,12,12),
     . Ld311(8,12,12),Ld314(8,12,12),Ld322(8,12,12),Ld344(8,12,12),
     . Le1(8,8,8,8)

      s12=s(p1,p2)
      s13=s(p1,p3)
      s14=s(p1,p4)
      s23=s(p2,p3)
      s24=s(p2,p4)
      s34=s(p3,p4)
      p12=p1+p2
      p13=p1+p3
      p14=p1+p4
      p23=p2+p3
      p24=p2+p4
      p34=p3+p4
      p123=p1+p2+p3
      p124=p1+p2+p4
      p134=p1+p3+p4
      p234=p2+p3+p4
      s123=s12+s13+s23
      s124=s12+s14+s24
      s134=s13+s14+s34
      s234=s23+s24+s34
      s1234=s12+s13+s14+s23+s24+s34

      LA=0d0

      LA = LA + S13**(-1)*S23**(-1)*S34**(-1)*S234**(-1)*S134**(-1)
     +  * ( 8*s13**4*s23*s24*S14**(-1)*S24**(-1) - 8*s13**4*s24**2*
     +    S14**(-1)*S24**(-1) + 8*s13**3*s14*s23*s24*S14**(-1)*
     +    S24**(-1) - 8*s13**3*s14*s24**2*S14**(-1)*S24**(-1) + 8*
     +    s13**3*s23*s24*s34*S14**(-1)*S24**(-1) - 8*s13**3*s24**2*s34*
     +    S14**(-1)*S24**(-1) - 8*s13**2*s23*s24**3*S14**(-1)*S24**(-1)
     +     - 8*s13**2*s24**4*S14**(-1)*S24**(-1) - 8*s13**2*s24**3*s34*
     +    S14**(-1)*S24**(-1) - 8*s13*s14**3*s23**2*S14**(-1)*S24**(-1)
     +     - 8*s14**4*s23**2*S14**(-1)*S24**(-1) - 8*s14**3*s23**2*s34*
     +    S14**(-1)*S24**(-1) )

      LA = LA + S13**(-1)*S23**(-1)*S234**(-1)*S134**(-1) * (  - 120*
     +    s12**3*s14*S24**(-1) + 232*s12**3 - 16*s12**2*s14 - 16*s12*
     +    s14*s24 )

      LA = LA + S13**(-1)*S23**(-1)*S234**(-1) * ( 8*s12**3*S14**(-1)
     +     + 120*s12**3*S24**(-1) + 4*s12**2*s14*S24**(-1) + 128*s12**2
     +     - 8*s12*s14**2*S24**(-1) + 48*s12*s14 - 44*s12*s24 + 4*s14*
     +    s24 )

      LA = LA + S13**(-1)*S23**(-1)*S134**(-1) * (  - 112*s12**3*
     +    S24**(-1) + 4*s12**2*s24*S14**(-1) + 112*s12**2 - 44*s12*s14
     +     - 8*s12*s24**2*S14**(-1) + 48*s12*s24 + 4*s14*s24 )

      LA = LA + S13**(-1)*S23**(-1) * ( 112*s12**3*S14**(-1)*S24**(-1)
     +     + 32*s12**2*s34*S14**(-1)*S24**(-1) + 116*s12**2*S14**(-1)
     +     + 116*s12**2*S24**(-1) + 52*s12*s14*S24**(-1) + 52*s12*s24*
     +    S14**(-1) - 16*s12*s34*S14**(-1) - 16*s12*s34*S24**(-1) + 64*
     +    s12 + 16*s14*s34*S24**(-1) + 20*s14 + 16*s24*s34*S14**(-1) + 
     +    20*s24 )

      LA = LA + S13**(-1)*S34**(-1)*S234**(-1) * (  - 16*s12*s14 - 16*
     +    s14**2 + 8*s14*s23 )

      LA = LA + S13**(-1)*S34**(-1) * ( 28*s12*s14*S24**(-1) + 28*s12*
     +    s23*S24**(-1) + 16*s14**2*S24**(-1) + 16*s14*s23*S24**(-1) + 
     +    16*s23**2*S24**(-1) + 8*s23 )

      LA = LA + S13**(-1)*S234**(-1)*S134**(-1) * ( 232*s12**3*
     +    S24**(-1) + 248*s12**2*s14*S24**(-1) + 176*s12*s14*s23*
     +    S24**(-1) - 56*s12*s14 + 48*s14**2*s23*S24**(-1) + 48*s14**2
