     +    s12*s14*s23*s34 + 32*s12*s14*s34**2 + 16*s13**2*s24*s34 - 16*
     +    s13*s14*s23*s34 - 16*s13*s14*s24*s34 - 16*s13*s23*s24*s34 + 
     +    16*s14**2*s23*s34 + 16*s14*s23**2*s34 )

      uc14 = uc14 + Ld1(p2,p3,p14)*S23**(-1)*S34**(-1)*S123**(-1) * ( 
     +     - 16*s12**2*s34 + 16*s12*s13*s34 - 48*s12*s14*s34 - 16*s12*
     +    s23*s34 )

      uc14 = uc14 + Ld1(p2,p3,p14)*S23**(-1)*S34**(-1)*S234**(-1)*
     + S134**(-1) * (  - 32*s12**2*s13*s34 + 32*s12**2*s14*s34 + 64*s12
     +    *s13**2*s34 + 32*s12*s13*s14*s34 - 16*s12*s13*s23*s34 - 48*
     +    s12*s13*s24*s34 + 48*s12*s13*s34**2 + 32*s12*s14**2*s34 + 48*
     +    s12*s14*s23*s34 + 16*s12*s14*s24*s34 + 16*s12*s14*s34**2 + 32
     +    *s13**2*s24*s34 - 32*s13*s14*s23*s34 - 16*s13*s23*s24*s34 - 
     +    16*s13*s24**2*s34 + 16*s13*s24*s34**2 + 16*s14*s23**2*s34 + 
     +    16*s14*s23*s24*s34 - 16*s14*s23*s34**2 )

      uc14 = uc14 + Ld1(p2,p3,p14)*S23**(-1)*S34**(-1)*S234**(-1) * ( 
     +     - 32*s12**2*s34 + 32*s12*s13*s34 - 32*s12*s14*s34 - 16*s12*
     +    s23*s34 - 16*s12*s24*s34 + 16*s12*s34**2 )

      uc14 = uc14 + Ld21(p1,p4,p3)*S23**(-1)*S34**(-1)*S234**(-1)*
     + S134**(-1) * ( 16*s12**2*s34**2 - 32*s12*s14*s23*s34 + 16*s14**2
     +    *s23**2 )

      uc14 = uc14 + Ld21(p2,p3,p4)*S23**(-1)*S34**(-1)*S123**(-1)*
     + S234**(-1) * (  - 16*s12**2*s34**2 )

      uc14 = uc14 + Ld21(p2,p3,p14)*S23**(-1)*S34**(-1)*S123**(-1)*
     + S134**(-1) * ( 16*s13**2*s23*s34 + 32*s13*s14*s23*s34 + 16*
     +    s14**2*s23*s34 )

      uc14 = uc14 + Ld21(p2,p3,p14)*S23**(-1)*S34**(-1)*S234**(-1)*
     + S134**(-1) * ( 16*s13**2*s23*s34 + 32*s13*s14*s23*s34 + 16*
     +    s14**2*s23*s34 )

      uc14 = uc14 + Ld21(p4,p3,p2)*S23**(-1)*S34**(-1)*S123**(-1)*
     + S234**(-1) * ( 32*s12*s14*s34**2 - 16*s14**2*s23*s34 )

      uc14 = uc14 + Ld22(p2,p3,p14)*S23**(-1)*S34**(-1)*S123**(-1)*
     + S134**(-1) * (  - 16*s12*s13**2*s34 + 16*s13**2*s23*s34 - 16*
     +    s13**2*s24*s34 + 32*s13*s14*s23*s34 )

      uc14 = uc14 + Ld22(p2,p3,p14)*S23**(-1)*S34**(-1)*S234**(-1)*
     + S134**(-1) * (  - 16*s12*s13**2*s34 + 16*s13**2*s23*s34 - 16*
     +    s13**2*s24*s34 + 32*s13*s14*s23*s34 )

      uc14 = uc14 + Ld24(p2,p3,p14)*S23**(-1)*S34**(-1)*S123**(-1)*
     + S134**(-1) * ( 48*s12**2*s13*s34 + 16*s12**2*s34**2 + 32*s12*s13
     +    *s24*s34 - 32*s12*s14*s23*s34 )

      uc14 = uc14 + Ld24(p2,p3,p14)*S23**(-1)*S34**(-1)*S234**(-1)*
     + S134**(-1) * ( 48*s12**2*s13*s34 + 16*s12**2*s34**2 + 32*s12*s13
     +    *s24*s34 - 32*s12*s14*s23*s34 )

      uc14 = uc14 + Le1(p1,p4,p3,p2)*S23**(-1)*S34**(-1)*S123**(-1)
     +  * (  - 16*s12**2*s14*s34 + 16*s12*s13**2*s23 + 16*s12*s14**2*
     +    s23 + 32*s12*s14**2*s24 + 16*s12*s14**2*s34 - 16*s12*s14*s23*
     +    s34 - 16*s13**2*s14*s23 + 16*s13**2*s23**2 - 32*s13*s14**2*
     +    s23 - 16*s14**3*s23 + 16*s14**2*s23**2 + 32*s14**2*s23*s24 )

      uc14 = uc14 + Le1(p1,p4,p3,p2)*S23**(-1)*S34**(-1)*S234**(-1)
     +  * (  - 16*s12**2*s23*s34 + 32*s12*s13*s23**2 - 16*s12*s13*s23*
     +    s34 + 16*s12*s14*s23**2 - 16*s12*s14*s23*s34 + 16*s12*s14*
     +    s24**2 + 16*s12*s14*s24*s34 + 16*s12*s23**2*s34 + 32*s13**2*
     +    s23**2 + 64*s13*s14*s23**2 + 16*s13*s14*s23*s34 + 16*s13*
     +    s23**2*s34 + 16*s14**2*s23**2 - 32*s14**2*s23*s24 - 16*s14**2
     +    *s24**2 - 16*s14**2*s24*s34 - 16*s14*s23**3 - 32*s14*s23**2*
     +    s24 - 16*s14*s23*s24**2 - 16*s14*s23*s24*s34 )

